import React from 'react';
import Search from './Search';

function Header({ setUserQuery, setUserZip }) {
    return (
        <header className="site-header">
            <div className="wrap">
                <img src="../../assets/images/how-can-you-help-logo.png" />
            </div>
        </header>
    );
}

export default Header;
